import React from 'react';
import BizHeader from './BizHeader';
import NavBar from './Navbar';
import PageContent from './PageContent';
import Footer from './Footer';

function App() {
  return (
    <>
      <NavBar />
      <BizHeader />
      <PageContent />
      <Footer />
    </>
  );
}

export default App;
